/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	class="ui5-calheader-root"	dir="${ifDefined(context.rtl)}"	@keydown=${context._onkeydown}><div		id="${ifDefined(context._id)}-btnPrev"		class="${ifDefined(context._btnPrev.classes)}"		@click=${context._handlePrevPress}		data-sap-cal-head-button="Prev"	><ui5-icon			class="ui5-calheader-arrowicon"			name="${ifDefined(context._btnPrev.icon)}"		></ui5-icon></div><div class="ui5-calheader-midcontainer"><div			id="${ifDefined(context._id)}-btn1"			class="ui5-calheader-arrowbtn ui5-calheader-middlebtn"			type="${ifDefined(context._btn1.type)}"			tabindex="0"			@click=${context._showMonthPicker}			data-sap-show-picker="Month"		>			${ifDefined(context._btn1.text)}</div><div			id="${ifDefined(context._id)}-btn2"			class="ui5-calheader-arrowbtn ui5-calheader-middlebtn"			type="${ifDefined(context._btn2.type)}"			tabindex="0"			@click=${context._showYearPicker}			data-sap-show-picker="Year"		>			${ifDefined(context._btn2.text)}</div></div><div		class="${ifDefined(context._btnNext.classes)}"		@click=${context._handleNextPress}		id="${ifDefined(context._id)}-btnNext"		data-sap-cal-head-button="Next"	><ui5-icon			class="ui5-calheader-arrowicon"			name="${ifDefined(context._btnNext.icon)}"		></ui5-icon></div>`; };

export default block0;
